import React, { Component } from 'react';
import logo from './logo.svg';
import InvoiceBody from './InvoiceBody';

class Invoice extends Component{
    render(){
      return(
        <div className="card">
          <img src={logo} className="App-logo" alt="logo" />  

          <InvoiceBody/>
          <InvoiceBody/>
        </div>
        );  
    }
}
export default Invoice;
